const React = require('react');
const { ListGroup, Button } = require('react-bootstrap');
const { Redirect } = require('react-router-dom');

export class Main extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      redirect: false,
      path: '/'
    };
    this.handleClick.bind(this);
  }
  handleClick = (path) => {
    this.setState({
      redirect: true,
      path
    });
  };
  render() {
    return (
      <div className={this.props.className}>
        <ListGroup>
          <ListGroup.Item>
            Go to URL-shortener:
            <Button
              variant="primary"
              onClick={() => this.handleClick('/short')}
              >
              Click
            </Button>
          </ListGroup.Item>
        </ListGroup>
        {this.state.redirect && <Redirect to={this.state.path}/>}
      </div>
    );
  }
}
